const puppeteer = require("puppeteer");

async function IndicesScrape(url) {
    const browser = await puppeteer.launch();
    const page = await browser.newPage();
    await page.goto(url);
    const [el] = await page.$x('//*[@id="liveindexTable"]/tbody');
    console.log(el)
}

export default IndicesScrape;
